#' @param showResponses .
#' @param showCases .
#' @param yaxis .
#' @param horizontal .
#' @param showLabels .
#' @param accuracy .
#' @param labelFontSize .
#' @param colorPalette .
#' @param singleColor .
#' @param colorNo .
#' @param borderColor .
#' @param textColor .
#' @param titleText .
#' @param titleFontFace .
#' @param titleFontSize .
#' @param titleAlign .
#' @param subtitleText .
#' @param subtitleFontFace .
#' @param subtitleFontSize .
#' @param subtitleAlign .
