#' @return A results object containing:
#' \tabular{llllll}{
#'   \code{results$responses} \tab \tab \tab \tab \tab a table \cr
#'   \code{results$plot} \tab \tab \tab \tab \tab an image \cr
#' }
#'
#' Tables can be converted to data frames with \code{asDF} or \code{\link{as.data.frame}}. For example:
#'
#' \code{results$responses$asDF}
#'
#' \code{as.data.frame(results$responses)}
#'
#' @export
mrfrequencies <- function(
    data,
    mode,
    repVar,
    separator = ";",
    emptyAsNA = TRUE,
    resps,
    endorsed = 1,
    optionname = "Options",
    order = "decreasing",
    showTotal = TRUE,
    showCounts = TRUE,
    labelPosition = "middle",
    showResponses = TRUE,
    showCases = TRUE,
    yaxis = "cases",
    horizontal = FALSE,
    showLabels = FALSE,
    accuracy = "0.1",
    labelFontSize = 12,
    colorPalette = "jmv",
    singleColor = TRUE,
    colorNo = 1,
    borderColor = "none",
    textColor = "auto",
    titleText,
    titleFontFace = "bold",
    titleFontSize = "14",
    titleAlign = "0.5",
    subtitleText,
    subtitleFontFace = "plain",
    subtitleFontSize = "12",
    subtitleAlign = "0.5",
    captionText,
    captionFontFace = "italic",
    captionFontSize = "10",
    captionAlign = "1",
    xAxisText,
    xAxisFontSize = "16",
    xAxisPosition = "0.5",
    yAxisText,
    yAxisFontSize = "16",
    yAxisPosition = "0.5",
    yAxisLabelFontSize = 12,
    yAxisLabelRotation = 0,
    yAxisRangeType = "auto",
    yAxisRangeMin = 0,
    yAxisRangeMax = 10,
    xAxisLabelFontSize = 12,
    xAxisLabelRotation = 0,
    xAxisRangeType = "auto",
    xAxisRangeMin = 0,
    xAxisRangeMax = 10) {

    if ( ! requireNamespace("jmvcore", quietly=TRUE))
        stop("mrfrequencies requires jmvcore to be installed (restart may be required)")

    if ( ! missing(repVar)) repVar <- jmvcore::resolveQuo(jmvcore::enquo(repVar))
    if ( ! missing(resps)) resps <- jmvcore::resolveQuo(jmvcore::enquo(resps))
    if (missing(data))
        data <- jmvcore::marshalData(
            parent.frame(),
            `if`( ! missing(repVar), repVar, NULL),
            `if`( ! missing(resps), resps, NULL))

    for (v in repVar) if (v %in% names(data)) data[[v]] <- as.factor(data[[v]])
    for (v in resps) if (v %in% names(data)) data[[v]] <- as.factor(data[[v]])

    options <- mrfrequenciesOptions$new(
        mode = mode,
